import React from "react";

export default function Login({ isOpen, children, closeLogin }) {
  if (!isOpen) return null;

  return (
    <div className="overlay">
      <div className="overlay-content usertxt">
        <button className="btn btn-sm loginbtnpos" onClick={closeLogin}>
          X
        </button>
        {children}
        USERNAME:
        <input
          className="input"
          id="user"
          name="user"
          placeholder="Input Username"
        ></input>
        <div>PASSWORD:</div>
      </div>
    </div>
  );
}
